webpackJsonp([26048893403927],{396:function(e,i){e.exports={data:{site:{siteMetadata:{title:"keto.nyc",author:"Una Kravets"}},markdownRemark:{id:"/Users/unakravets/Dev/keto.nyc/src/pages/2018-08-26-garlic-butter-shrimp-zoodles/index.md absPath of file >>> MarkdownRemark",html:'<h2>You’ll Need:</h2>\n<ul>\n<li>8 oz  Frozen cooked shrimp (we used 100-200 size)</li>\n<li>12 oz zucchini noodles (or <a href="https://amzn.to/2PCaFzQ">spiraled zucchini</a>)</li>\n<li>4 tbsp (2 oz) <a href="https://amzn.to/2MSRzHe">grass-fed butter</a></li>\n<li>0.5 cup of riced cauliflower</li>\n<li>4 cloves of garlic, minced</li>\n<li>0.5 tbs garlic powder</li>\n<li>Salt and pepper to taste</li>\n<li>0.5 cup celery, chopped</li>\n</ul>\n<h2>Directions:</h2>\n<ol>\n<li>Sauté garlic in 2 tbsp of butter, then add celery and shrimp</li>\n<li>When shrimp is fully defrosted and simmering, add 2 more tbsp of butter with zucchini noodles. </li>\n<li>Add garlic powder, salt, and pepper</li>\n<li>Continue to stir as you add the riced cauliflower. If desired, add more garlic powder</li>\n<li>Serve with a side salad (optional)</li>\n</ol>',frontmatter:{date:"August 26, 2018",protein:38,funFact:"A Smith Street creation",servings:2,netCarbs:7.5,calories:328,fat:15,carbs:13,title:"Garlic Butter Shrimp Zoodles",fiber:6,sugars:0,prepTime:"10 minutes",cookTime:"20 minutes",readyTime:"30 minutes",image1:{childImageSharp:{resolutions:{width:800,height:534,src:"/static/cover-f06696a96567a4e60fac8605dbef0f29-4042a.jpg",srcSet:"/static/cover-f06696a96567a4e60fac8605dbef0f29-4042a.jpg 1x"}}},image2:{childImageSharp:{resolutions:{width:800,height:534,src:"/static/secondary-aac2ed3a18ca227f1780887638ea6390-4042a.jpg",srcSet:"/static/secondary-aac2ed3a18ca227f1780887638ea6390-4042a.jpg 1x"}}}}}},pathContext:{slug:"/2018-08-26-garlic-butter-shrimp-zoodles/",previous:{fields:{slug:"/2018-08-25-cheddar-cloud-biscuits-with-lox/"},frontmatter:{title:"Cheddar Cloud Biscuits with Lox"}},next:null}}}});
